import React, { useState } from "react";
import AnimatedCursor from "react-animated-cursor";
import "./App.sass";

import Main from "./components/Main";

function App() {
  return (
    <div>
      <AnimatedCursor
        innerSize={8}
        outerSize={8}
        color="193, 11, 111"
        outerAlpha={0.2}
        innerScale={0.7}
        outerScale={5}
      />
      <Main></Main>
    </div>
  );
}

export default App;
